import React from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { signOut } from "firebase/auth";
import { auth } from '../firebase.js';
import Card from 'react-bootstrap/Card';
import { Row, Col } from 'react-bootstrap';
import Button from 'react-bootstrap/Button';

// Rewards

export default function TeacherDashboard() {

  let navigate = useNavigate();
  const logout = async () => {
    await signOut(auth);
    navigate('/');
  };
  return (
    <div>
      <h1>Teacher Dashboard</h1>
      <Button onClick={() => {
        navigate('/studentAdmin');
      }}>Student Administration</Button>
      <Button onClick={() => {
        navigate('/rewardsAdmin');
      }}>Rewards Administration</Button>
      <Button onClick={() => {
        navigate('/badgesAdmin');
      }}>Badges Administration</Button>
      <Button onClick={() => {
        navigate('/mazeAdmin');
      }}>Maze Administration</Button>
      <Button onClick={() => {
        navigate('/leaderboardAdmin');
      }}>Leaderboard Administration</Button>
      <Button onClick={() => {
        navigate('/profileTeacher');
      }}>Profile</Button>
      <Button onClick={logout}>Sign Out</Button>
      <Row xs={1} md={3} lg={4} className="g-4">
        {Array.from({ length: 4 }).map((_, idx) => (
          <Col>
            <Card style={{ width: '18rem' }}>
              <Card.Img variant="top" src="holder.js/100px180" />
              <Card.Body>
                <Card.Title>Card Title</Card.Title>
                <Card.Text>
                  Some quick example text to build on the card title and make up the bulk of
                  the card's content.
                </Card.Text>
                <Button variant="primary">Go somewhere</Button>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>
    </div>
  );
}
